import math

def max_enclosed_points(points):
    eps1 = 1 - 1.0 / 10 ** 13

    def cc(x1, y1, x2, y2):
        xd = x2 - x1
        yd = y2 - y1
        xc = (x1 + x2) / 2
        yc = (y1 + y2) / 2
        k = pow(1.0 / (xd ** 2 + yd ** 2) - 0.25, 0.5)
        xd *= k
        yd *= k
        return [[xc - yd, yc + xd], [xc + yd, yc - xd]]
    n = len(points)
    r = 1
    for i in range(n):
        (ax, ay) = points[i]
        for j in range(i + 1, n):
            (bx, by) = points[j]
            if bx - ax > 2:
                break
            if pow(ax - bx, 2) + pow(ay - by, 2) > 4:
                continue
            for (x, y) in cc(ax, ay, bx, by):
                t = 0
                for k in range(n):
                    if x - points[k][0] > 1:
                        continue
                    if points[k][0] - x > 1:
                        break
                    if pow(x - points[k][0], 2) + pow(y - points[k][1], 2) < eps1:
                        t += 1
                if r < t:
                    r = t
    return r

